INSERT INTO `clinical_summary` VALUES (1,'Basic Clinical Summary','Defines a basic clinical summary based mostly on concepts in the base concept dataset.','<?xml version=\"1.0\"?>\r\n<clinicalSummaryList>\r\n\r\n#foreach($patientId in $patientSet.patientIds)\r\n$!{fn.setPatientId($patientId)}\r\n<clinicalSummary>\r\n	<id>$!{fn.getPatientAttr(\'PatientIdentifier\', \'identifier\')}</id>\r\n	<name>\r\n		$!{fn.getPatientAttr(\'PersonName\', \'givenName\')} \r\n		$!{fn.getPatientAttr(\'PersonName\', \'middleName\')} \r\n		$!{fn.getPatientAttr(\'PersonName\', \'familyName\')}\r\n	</name>\r\n	#set($age = $!{fn.getAge($fn.getPatientAttr(\'Person\', \'birthdate\'))})\r\n	<age units=\"${age.get(1)}\">\r\n		${age.get(0)}\r\n	</age>\r\n	<firstEncounterDate>\r\n		$!{fn.formatDate(\'dd-MMM-yyyy\', ${fn.getFirstEncounterAttrsByType([\'\'],\n			\'encounterDatetime\')})}\r\n	</firstEncounterDate>\r\n	<healthCenter>${fn.getValueAsString($!{fn.getPersonAttribute(\'Health Center\',\n			\'Location\', \'locationId\', \'name\', false)})}</healthCenter>\r\n	<whoStage>${fn.getValueAsString(${fn.getLastObs(\'5356\')})}</whoStage>\r\n	<perfectAdherence>\r\n		#set($obsValues = $fn.getObsTimeframe(\'1164\', 12))\r\n		#if (${obsValues.size()} < 1)\r\n			unknown\r\n		#else\r\n			#set($all = true)\r\n			#foreach($val in $obsValues)\r\n				#if (!(${val.getConceptId()} == 1163))#set($all = false)#end\r\n			#end\r\n			#if ($all == true)\r\n				true\r\n			#else\r\n				false\r\n			#end\r\n		#end\r\n	</perfectAdherence>\r\n	<problemList>\r\n		<!-- Make a list of all PROBLEM ADDED without a subsequent matching PROBLEM RESOLVED -->\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getIntersectedObs(\'6042\', \'6097\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<problem date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0).getName()})}\r\n			</problem>\r\n		#end\r\n	</problemList>\r\n	<flowsheet>\r\n  	<!--\r\n  		List all known values for\r\n  			WEIGHT (KG),\r\n  			HGB (concept HEMOGLOBIN),\r\n  			SAO2 (concept BLOOD OXYGEN SATURATION),\r\n  			CD4 (CD4, BY FACS),\r\n  			SGPT\r\n  		All dates should be in MM-DD-YYYY format\r\n  		For CD4: if CD4% exists on same day, repeat as CD4 (%), e.g. <value date=\"...\">252 (16%)</value>\r\n  	-->\r\n	<results name=\"WEIGHT (KG)\">\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getLastNObsWithValues(-1, \'5089\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<value date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0)})}\r\n			</value>\r\n		#end\r\n	</results>\r\n	<results name=\"HGB\">\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getLastNObsWithValues(-1, \'21\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<value date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0)})}\r\n			</value>\r\n		#end\r\n	</results>\r\n	<results name=\"SA02\">\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getLastNObsWithValues(-1, \'5092\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<value date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0)})}\r\n			</value>\r\n		#end\r\n	</results>\r\n	<results name=\"CD4\">\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getLastNObsWithValues(-1, \'5497\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<value date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0)})}\r\n			</value>\r\n		#end\r\n	</results>\r\n	<results name=\"SGPT\">\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getLastNObsWithValues(-1, \'654\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<value date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0)})}\r\n			</value>\r\n		#end\r\n	</results>\r\n	</flowsheet>\r\n\r\n	#set($arr = [\'obsDatetime\'])\r\n	#set($obsValues = $fn.getLastNObsWithValues(-1, \'12\', $arr))\r\n	#foreach($vals in $obsValues)\r\n		#if($velocityCount == 1)<cxr date=\"${fn.formatDate(\'short\', ${vals.get(1)})}\">#end\r\n			${fn.getValueAsString(${vals.get(0)})}\r\n			#if($velocityCount > 1) , #end\r\n		#if($velocityCount == ${obsValues.size()})</cxr>#end\r\n	#end\r\n\r\n</clinicalSummary>\r\n#end <!-- ending patient loop -->\r\n\r\n</clinicalSummaryList>','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsl:stylesheet version=\"2.0\" xmlns:xsl=\"http://www.w3.org/1999/XSL/Transform\" \r\n	xmlns:fo=\"http://www.w3.org/1999/XSL/Format\" xmlns:fn=\"http://www.w3.org/2005/02/xpath-functions\"\r\n	exclude-result-prefixes=\"fo\">\r\n<xsl:output method=\"xml\" version=\"1.0\" omit-xml-declaration=\"no\" indent=\"yes\"/>\r\n\r\n<xsl:summary match=\"clinicalSummaryList\">\r\n<fo:root xmlns:fo=\"http://www.w3.org/1999/XSL/Format\">\r\n	<fo:layout-master-set>\r\n		<fo:simple-page-master master-name=\"simpleA4\" page-height=\"29.7cm\" page-width=\"21cm\"\r\n			margin-top=\"1cm\" margin-left=\"1cm\" margin-right=\"1cm\" margin-bottom=\"1cm\">\r\n			<fo:region-body margin-top=\"1.2cm\" margin-bottom=\"1.2cm\" />\r\n			<fo:region-before extent=\"3cm\"  />\r\n			<fo:region-after extent=\"1cm\" />\r\n		</fo:simple-page-master>\r\n	</fo:layout-master-set>\r\n	\r\n	<!-- Begin Summary -->\r\n	<xsl:for-each select=\"clinicalSummary\">\r\n	<fo:page-sequence master-reference=\"simpleA4\">\r\n		<!-- Header -->\r\n		<fo:static-content flow-name=\"xsl-region-before\" font-family=\"Helvetica\">\r\n			<fo:block text-align=\"center\"\r\n				border-top=\"thin solid grey\"\r\n				border-left=\"thin solid grey\"\r\n				border-right=\"thin solid black\"\r\n				border-bottom=\"thin solid black\"\r\n				background-color=\"#e0e0e0\"\r\n				padding=\"0.2cm\"\r\n				space-after=\"12pt\"\r\n				font-weight=\"bold\">AMPATH Medical Record System Clinical Summary</fo:block>\r\n		</fo:static-content>\r\n		<!-- Footer -->\r\n		<fo:static-content flow-name=\"xsl-region-after\" font-family=\"Helvetica\">\r\n			<fo:table table-layout=\"fixed\" width=\"100%\">\r\n				<fo:table-column column-width=\"60%\" />\r\n				<fo:table-column column-width=\"40%\" />\r\n				<fo:table-body>\r\n					<fo:table-row height=\"1cm\">\r\n						<fo:table-cell display-align=\"center\">\r\n							<fo:block text-align=\"left\" font-size=\"8pt\">Printed on <xsl:value-of select=\"format-dateTime(current-dateTime(),\'[Y0001]-[M01]-[D01] at [H01]:[m01]:[s01]\')\" /></fo:block>\r\n						</fo:table-cell>\r\n						<fo:table-cell display-align=\"center\">\r\n							<fo:block text-align=\"right\" font-size=\"20pt\" font-weight=\"bold\">\r\n								<xsl:value-of select=\"id\" />\r\n							</fo:block>\r\n						</fo:table-cell>\r\n					</fo:table-row>\r\n				</fo:table-body>\r\n			</fo:table>		\r\n			<fo:block>\r\n			</fo:block>\r\n		</fo:static-content>\r\n		\r\n		<!-- Begin Page Content -->\r\n		<fo:flow flow-name=\"xsl-region-body\" font-family=\"Helvetica\" font-size=\"14pt\">\r\n			<fo:table table-layout=\"fixed\" width=\"100%\">\r\n				<fo:table-column column-width=\"60%\" />\r\n				<fo:table-column column-width=\"40%\" />\r\n				<fo:table-body font-size=\"20pt\">\r\n					<fo:table-row height=\"1cm\">\r\n						<fo:table-cell>\r\n							<fo:block font-weight=\"bold\" font-style=\"italic\"><xsl:value-of select=\"name\" /></fo:block>\r\n						</fo:table-cell>\r\n						<fo:table-cell text-align=\"right\">\r\n							<fo:block font-weight=\"bold\"><xsl:value-of select=\"id\" /></fo:block>\r\n						</fo:table-cell>\r\n					</fo:table-row>\r\n				</fo:table-body>\r\n			</fo:table>\r\n			<fo:block font-size=\"14pt\" space-after=\"6pt\">\r\n				<fo:inline><xsl:value-of select=\"birthdate/@age\" /></fo:inline>\r\n				<xsl:choose>\r\n					<xsl:when test=\"gender = \'M\'\">\r\n						<fo:inline> male</fo:inline>\r\n					</xsl:when>\r\n					<xsl:when test=\"gender = \'F\'\">\r\n						<fo:inline> female</fo:inline>\r\n					</xsl:when>\r\n				</xsl:choose>\r\n			</fo:block>\r\n			<fo:block>\r\n				<fo:inline>First Encounter on <xsl:value-of select=\"firstEncounterDate\" /></fo:inline>\r\n			</fo:block>\r\n			<fo:block>\r\n				<fo:inline>WHO Stage: <xsl:value-of select=\"whoStage\" /></fo:inline>\r\n			</fo:block>\r\n			<fo:block>Perfect HIV Rx Adherence (past year): <xsl:value-of select=\"perfectAdherence\" /></fo:block>\r\n			<!-- <fo:block text-align=\"center\" space-before=\"12pt\" space-after=\"12pt\">\r\n				<fo:leader leader-summary=\"rule\" leader-length=\"80%\" color=\"#808080\" />\r\n			</fo:block> -->\r\n			\r\n			<fo:table table-layout=\"fixed\"\r\n				width=\"100%\"\r\n				border-spacing=\"0.25in\" space-before=\"6pt\"\r\n				space-after=\"6pt\">\r\n				<fo:table-column column-width=\"50%\" />\r\n				<fo:table-column column-width=\"50%\" />\r\n				<fo:table-body font-size=\"20pt\">\r\n					<fo:table-row height=\"7cm\">\r\n						<fo:table-cell>\r\n\r\n			<!-- Problem list -->\r\n			<fo:block font-size=\"18pt\"\r\n				space-before=\"8pt\"\r\n				space-after=\"8pt\"><fo:inline text-decoration=\"underline\">Problem List</fo:inline>:</fo:block>\r\n			<xsl:if test=\"problemList/problem\">\r\n				<fo:list-block font-size=\"14pt\" space-after=\"12pt\"\r\n					provisional-label-separation=\"4mm\" provisional-distance-between-starts=\"10mm\">\r\n					<xsl:for-each select=\"problemList/problem\">\r\n					<fo:list-item>\r\n						<fo:list-item-label end-indent=\"label-end()\">\r\n							<fo:block><xsl:value-of select=\"position()\" />.</fo:block>\r\n						</fo:list-item-label>\r\n						<fo:list-item-body start-indent=\"body-start()\">\r\n							<fo:block>\r\n								<xsl:value-of select=\".\" />\r\n								<xsl:if test=\"@date\">\r\n									<xsl:text> (</xsl:text>\r\n									<xsl:value-of select=\"@date\" />\r\n									<xsl:text>)</xsl:text>\r\n								</xsl:if>\r\n							</fo:block>\r\n						</fo:list-item-body>\r\n					</fo:list-item>\r\n					</xsl:for-each>\r\n				</fo:list-block>\r\n			</xsl:if>\r\n\r\n						</fo:table-cell>\r\n						<fo:table-cell>\r\n						\r\n			<!-- Medications -->\r\n			<fo:block font-size=\"18pt\"\r\n				space-before=\"8pt\"\r\n				space-after=\"8pt\"><fo:inline text-decoration=\"underline\">Medications</fo:inline>:</fo:block>\r\n			<xsl:if test=\"medications/medication\">\r\n				<fo:list-block font-size=\"14pt\" space-after=\"12pt\"\r\n					provisional-label-separation=\"4mm\" provisional-distance-between-starts=\"10mm\">\r\n					<xsl:for-each select=\"medications/medication\">\r\n					<fo:list-item>\r\n						<fo:list-item-label end-indent=\"label-end()\">\r\n							<fo:block><xsl:value-of select=\"position()\" />.</fo:block>\r\n						</fo:list-item-label>\r\n						<fo:list-item-body start-indent=\"body-start()\">\r\n							<fo:block>\r\n								<xsl:value-of select=\".\" />\r\n								<!--\r\n								<xsl:if test=\"@date\">\r\n									<xsl:text> (</xsl:text>\r\n									<xsl:value-of select=\"@date\" />\r\n									<xsl:text>)</xsl:text>\r\n								</xsl:if>\r\n								-->\r\n							</fo:block>\r\n						</fo:list-item-body>\r\n					</fo:list-item>\r\n					</xsl:for-each>\r\n				</fo:list-block>\r\n			</xsl:if>\r\n\r\n						</fo:table-cell>\r\n					</fo:table-row>\r\n				</fo:table-body>\r\n			</fo:table>\r\n\r\n			<!-- Flowsheet -->\r\n			<fo:block font-size=\"18pt\"><fo:inline text-decoration=\"underline\">Flowsheet</fo:inline>:</fo:block>\r\n			<fo:table space-after=\"12pt\" table-layout=\"fixed\" width=\"100%\" border-collapse=\"collapse\">\r\n				<xsl:for-each select=\"flowsheet/results\">\r\n				<fo:table-column width=\"16%\" />\r\n				</xsl:for-each>\r\n				<fo:table-body>\r\n					<fo:table-row>\r\n						<xsl:for-each select=\"flowsheet/results\">\r\n							<xsl:element name=\"fo:table-cell\">\r\n								<xsl:attribute name=\"text-align\">center</xsl:attribute>\r\n								<xsl:attribute name=\"padding\">2pt</xsl:attribute>\r\n								<xsl:attribute name=\"border-bottom\">thin solid black</xsl:attribute>\r\n								<xsl:if test=\"not(position()=last())\">\r\n									<xsl:attribute name=\"border-right\">thin solid black</xsl:attribute>\r\n								</xsl:if>\r\n								<fo:block><xsl:value-of select=\"@name\" /></fo:block>\r\n							</xsl:element>\r\n						</xsl:for-each>\r\n					</fo:table-row>\r\n					<xsl:variable name=\"results\" select=\"flowsheet/results\" />\r\n					<xsl:variable name=\"cd4_percent\" select=\"cd4_percent\" />\r\n					<xsl:for-each select=\"(1,2,3,4,5)\">\r\n						<xsl:variable name=\"i\" select=\"position()\" />\r\n						<xsl:element name=\"fo:table-row\">\r\n							<xsl:attribute name=\"background-color\">\r\n								<xsl:if test=\"$i mod 2\">#F8F8F8</xsl:if>\r\n								<xsl:if test=\"not($i mod 2)\">#FFFFFF</xsl:if>\r\n							</xsl:attribute>\r\n							<xsl:attribute name=\"height\">1cm</xsl:attribute>\r\n							<xsl:for-each select=\"$results\">\r\n								<xsl:variable name=\"result_name\" select=\"@name\" />\r\n								<xsl:element name=\"fo:table-cell\">\r\n									<xsl:attribute name=\"text-align\">center</xsl:attribute>\r\n									<xsl:attribute name=\"display-align\">center</xsl:attribute>\r\n									<xsl:attribute name=\"padding\">2pt</xsl:attribute>\r\n									<xsl:if test=\"not(position()=last())\">\r\n										<xsl:attribute name=\"border-right\">thin solid black</xsl:attribute>\r\n									</xsl:if>\r\n									<xsl:choose>\r\n										<xsl:when test=\"($i=5) and (count(value) > 5)\">\r\n											<xsl:variable name=\"result_date\" select=\"value[position()=last()]/@date\" />\r\n											<fo:block>\r\n												<xsl:value-of select=\"value[position()=last()]\" />\r\n												<xsl:if test=\"$result_name=\'CD4\'\">\r\n													<xsl:variable name=\"p\" select=\"$cd4_percent/value[@date=$result_date]\" />\r\n													<xsl:if test=\"$p\">\r\n														<xsl:text> (</xsl:text>\r\n														<xsl:value-of select=\"normalize-space($p[position()=1])\" />\r\n														<xsl:text>%)</xsl:text>\r\n													</xsl:if>\r\n												</xsl:if>\r\n											</fo:block>\r\n											<xsl:if test=\"$result_date\">\r\n												<fo:block font-size=\"6pt\" font-style=\"italic\" color=\"#808080\">on <xsl:value-of select=\"substring($result_date,0,12)\" /></fo:block>\r\n											</xsl:if>\r\n										</xsl:when>\r\n										<xsl:when test=\"value[$i]\">\r\n											<xsl:variable name=\"result_date\" select=\"value[$i]/@date\" />\r\n											<fo:block>\r\n												<xsl:value-of select=\"value[$i]\" />\r\n												<xsl:if test=\"$result_name=\'CD4\'\">\r\n													<xsl:variable name=\"p\" select=\"$cd4_percent/value[@date=$result_date]\" />\r\n													<xsl:if test=\"$p\">\r\n														<xsl:text> (</xsl:text>\r\n														<xsl:value-of select=\"normalize-space($p[position()=1])\" />\r\n														<xsl:text>%)</xsl:text>\r\n													</xsl:if>\r\n												</xsl:if>\r\n											</fo:block>\r\n											<xsl:if test=\"$result_date\">\r\n												<fo:block font-size=\"6pt\" font-style=\"italic\" color=\"#808080\">on <xsl:value-of select=\"substring($result_date,0,12)\" /></fo:block>\r\n											</xsl:if>\r\n										</xsl:when>\r\n										<xsl:otherwise>\r\n											<fo:block></fo:block>\r\n										</xsl:otherwise>\r\n									</xsl:choose>\r\n								</xsl:element>\r\n							</xsl:for-each>\r\n						</xsl:element>\r\n					</xsl:for-each>\r\n				</fo:table-body>\r\n			</fo:table>\r\n			\r\n			<!-- Chest X-ray -->\r\n			<fo:block font-size=\"18pt\" text-decoration=\"underline\" space-after=\"6pt\">\r\n				Chest X-ray\r\n			</fo:block>\r\n			<xsl:choose>\r\n				<xsl:when test=\"cxr\">\r\n					<fo:block><xsl:value-of select=\"cxr/@date\" />: <xsl:value-of select=\"cxr\" /></fo:block>\r\n				</xsl:when>\r\n				<xsl:otherwise>\r\n					<fo:block>No chest x-ray results available.</fo:block>\r\n				</xsl:otherwise>\r\n			</xsl:choose>\r\n			\r\n			<!-- Reminders -->\r\n			<xsl:if test=\"reminderList\">\r\n				<fo:block font-size=\"18pt\" text-decoration=\"underline\" space-before=\"6pt\">\r\n					Reminders\r\n				</fo:block>\r\n				<xsl:for-each select=\"reminderList/reminder\">\r\n					<fo:block space-before=\"6pt\"><xsl:value-of select=\".\" /></fo:block>\r\n				</xsl:for-each>\r\n			</xsl:if>\r\n		</fo:flow>\r\n	</fo:page-sequence>\r\n	</xsl:for-each>\r\n</fo:root>\r\n</xsl:summary>\r\n\r\n</xsl:stylesheet>\r\n',1,1,'2007-03-16 14:20:22',1,'2007-03-19 10:12:34',1,'2b043dca-cde0-11e1-a6b2-907bb829a3b7',1),(2,'AMPATH Clinical Summary','Defines a clinical summary very similar to the basic summary except with the addition of the AMPATH medication list.','<?xml version=\"1.0\"?>\r\n<clinicalSummaryList>\r\n\r\n#foreach($patientId in $patientSet.patientIds)\r\n$!{fn.setPatientId($patientId)}\r\n<clinicalSummary>\r\n	<id>$!{fn.getPatientAttr(\'PatientIdentifier\', \'identifier\')}</id>\r\n	<name>\r\n		$!{fn.getPatientAttr(\'PersonName\', \'givenName\')} \r\n		$!{fn.getPatientAttr(\'PersonName\', \'middleName\')} \r\n		$!{fn.getPatientAttr(\'PersonName\', \'familyName\')}\r\n	</name>\r\n	<gender>$!{fn.getPatientAttr(\'Person\', \'gender\')}</gender>\r\n	#set($birthdate = $!{fn.getPatientAttr(\'Person\', \'birthdate\')})\r\n	#set($birthdate_estimated = $!{fn.getPatientAttr(\'Person\', \'birthdateEstimated\')})\r\n	#set($age = $!{fn.getAge(${birthdate})})\r\n	#if ($!{age.get(1)} == \"days\") #set($age_text = \"$!{age.get(0)} day-old\")\r\n	#else\r\n		#if ($!{age.get(1)} == \"months\") #set($age_text = \"$!{age.get(0)} month-old\")\r\n		#else #set($age_text = \"$!{age.get(0)} year-old\")\r\n		#end\r\n	#end\r\n	<birthdate estimate=\"${birthdate_estimated}\" age=\"$!{age_text}\">\r\n		$!{fn.formatDate(\'dd-MMM-yyyy\',${birthdate})}\r\n	</birthdate>\r\n	<firstEncounterDate>\r\n		$!{fn.formatDate(\'dd-MMM-yyyy\', ${fn.getFirstEncounterAttrsByType([\'\'],\n			\'encounterDatetime\')})}\r\n	</firstEncounterDate>\r\n	<healthCenter>${fn.getValueAsString($!{fn.getPersonAttribute(\'Health Center\',\n			\'Location\', \'locationId\', \'name\', false)})}</healthCenter>\r\n	<whoStage>${fn.getValueAsString(${fn.getLastObs(\'5356\')})}</whoStage>\r\n	<perfectAdherence>\r\n		#set($obsValues = $fn.getObsTimeframe(\'1164\', 12))\r\n		#if (${obsValues.size()} < 1)\r\n			unknown\r\n		#else\r\n			#set($all = true)\r\n			#foreach($val in $obsValues)\r\n				#if (!(${val.getConceptId()} == 1163))#set($all = false)#end\r\n			#end\r\n			#if ($all == true)\r\n				yes\r\n			#else\r\n				no\r\n			#end\r\n		#end\r\n	</perfectAdherence>\r\n	<problemList>\r\n		<!-- Make a list of all PROBLEM ADDED without a subsequent matching PROBLEM RESOLVED -->\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getIntersectedObs(\'6042\', \'6097\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<problem date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0).getName()})}\r\n			</problem>\r\n		#end\r\n	</problemList>\r\n	<flowsheet>\r\n  	<!--\r\n  		List all known values for\r\n  			WEIGHT (KG),\r\n  			HGB (concept HEMOGLOBIN),\r\n  			SAO2 (concept BLOOD OXYGEN SATURATION),\r\n  			CD4 (CD4, BY FACS),\r\n  			SGPT\r\n  		All dates should be in MM-DD-YYYY format\r\n  		For CD4: if CD4% exists on same day, repeat as CD4 (%), e.g. <value date=\"...\">252 (16%)</value>\r\n  	-->\r\n	<results name=\"WEIGHT (KG)\">\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getLastNObsWithValues(-1, \'5089\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<value date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0)})}\r\n			</value>\r\n		#end\r\n	</results>\r\n	<results name=\"HGB\">\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getLastNObsWithValues(-1, \'21\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<value date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0)})}\r\n			</value>\r\n		#end\r\n	</results>\r\n	<results name=\"SA02\">\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getLastNObsWithValues(-1, \'5092\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<value date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0)})}\r\n			</value>\r\n		#end\r\n	</results>\r\n	<results name=\"CD4\">\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getLastNObsWithValues(-1, \'5497\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<value date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0)})}\r\n			</value>\r\n		#end\r\n	</results>\r\n	<results name=\"SGPT\">\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getLastNObsWithValues(-1, \'654\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<value date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0)})}\r\n			</value>\r\n		#end\r\n	</results>\r\n	</flowsheet>\r\n	<cd4_percent>\r\n		#set($arr = [\'obsDatetime\'])\r\n		#set($obsValues = $fn.getLastNObsWithValues(-1, \'730\', $arr))\r\n		#foreach($vals in $obsValues)\r\n			<value date=\"${fn.formatDate(\'dd-MMM-yyyy\', ${vals.get(1)})}\">\r\n				${fn.getValueAsString(${vals.get(0)})}\r\n			</value>\r\n		#end\r\n	</cd4_percent>\r\n\r\n	#set($arr = [\'obsDatetime\'])\r\n	#set($obsValues = $fn.getLastNObsWithValues(-1, \'12\', $arr))\r\n	#foreach($vals in $obsValues)\r\n		#if($velocityCount == 1)<cxr date=\"${fn.formatDate(\'short\', ${vals.get(1)})}\">#end\r\n			${fn.getValueAsString(${vals.get(0)})}\r\n			#if($velocityCount > 1) , #end\r\n		#if($velocityCount == ${obsValues.size()})</cxr>#end\r\n	#end\r\n\r\n	#set($medValues = ${fn.getAmpathActiveMedications()})\r\n	#foreach($vals in $medValues)\r\n		#if($velocityCount == 1)<medications>#end\r\n		<medication date=\"${fn.formatDate(\'short\', ${vals.get(1)})}\">\r\n			${fn.getValueAsString(${vals.get(0)})}\r\n		</medication>\r\n		#if($velocityCount == ${medValues.size()})</medications>#end\r\n	#end\r\n\r\n</clinicalSummary>\r\n#end <!-- ending patient loop -->\r\n\r\n</clinicalSummaryList>\r\n','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsl:stylesheet version=\"2.0\" xmlns:xsl=\"http://www.w3.org/1999/XSL/Transform\" \r\n	xmlns:fo=\"http://www.w3.org/1999/XSL/Format\" xmlns:fn=\"http://www.w3.org/2005/02/xpath-functions\"\r\n	exclude-result-prefixes=\"fo\">\r\n<xsl:output method=\"xml\" version=\"1.0\" omit-xml-declaration=\"no\" indent=\"yes\"/>\r\n\r\n<xsl:summary match=\"clinicalSummaryList\">\r\n<fo:root xmlns:fo=\"http://www.w3.org/1999/XSL/Format\">\r\n	<fo:layout-master-set>\r\n		<fo:simple-page-master master-name=\"simpleA4\" page-height=\"29.7cm\" page-width=\"21cm\"\r\n			margin-top=\"1cm\" margin-left=\"1cm\" margin-right=\"1cm\" margin-bottom=\"1cm\">\r\n			<fo:region-body margin-top=\"1.2cm\" margin-bottom=\"1.2cm\" />\r\n			<fo:region-before extent=\"3cm\"  />\r\n			<fo:region-after extent=\"1cm\" />\r\n		</fo:simple-page-master>\r\n	</fo:layout-master-set>\r\n	\r\n	<!-- Begin Summary -->\r\n	<xsl:for-each select=\"clinicalSummary\">\r\n	<fo:page-sequence master-reference=\"simpleA4\">\r\n		<!-- Header -->\r\n		<fo:static-content flow-name=\"xsl-region-before\" font-family=\"Helvetica\">\r\n			<fo:block text-align=\"center\"\r\n				border-top=\"thin solid grey\"\r\n				border-left=\"thin solid grey\"\r\n				border-right=\"thin solid black\"\r\n				border-bottom=\"thin solid black\"\r\n				background-color=\"#e0e0e0\"\r\n				padding=\"0.2cm\"\r\n				space-after=\"12pt\"\r\n				font-weight=\"bold\">AMPATH Medical Record System Clinical Summary</fo:block>\r\n		</fo:static-content>\r\n		<!-- Footer -->\r\n		<fo:static-content flow-name=\"xsl-region-after\" font-family=\"Helvetica\">\r\n			<fo:table table-layout=\"fixed\" width=\"100%\">\r\n				<fo:table-column column-width=\"60%\" />\r\n				<fo:table-column column-width=\"40%\" />\r\n				<fo:table-body>\r\n					<fo:table-row height=\"1cm\">\r\n						<fo:table-cell display-align=\"center\">\r\n							<fo:block text-align=\"left\" font-size=\"8pt\">Printed on <xsl:value-of select=\"format-dateTime(current-dateTime(),\'[Y0001]-[M01]-[D01] at [H01]:[m01]:[s01]\')\" /></fo:block>\r\n						</fo:table-cell>\r\n						<fo:table-cell display-align=\"center\">\r\n							<fo:block text-align=\"right\" font-size=\"20pt\" font-weight=\"bold\">\r\n								<xsl:value-of select=\"id\" />\r\n							</fo:block>\r\n						</fo:table-cell>\r\n					</fo:table-row>\r\n				</fo:table-body>\r\n			</fo:table>		\r\n			<fo:block>\r\n			</fo:block>\r\n		</fo:static-content>\r\n		\r\n		<!-- Begin Page Content -->\r\n		<fo:flow flow-name=\"xsl-region-body\" font-family=\"Helvetica\" font-size=\"14pt\">\r\n			<fo:table table-layout=\"fixed\" width=\"100%\">\r\n				<fo:table-column column-width=\"60%\" />\r\n				<fo:table-column column-width=\"40%\" />\r\n				<fo:table-body font-size=\"20pt\">\r\n					<fo:table-row height=\"1cm\">\r\n						<fo:table-cell>\r\n							<fo:block font-weight=\"bold\" font-style=\"italic\"><xsl:value-of select=\"name\" /></fo:block>\r\n						</fo:table-cell>\r\n						<fo:table-cell text-align=\"right\">\r\n							<fo:block font-weight=\"bold\"><xsl:value-of select=\"id\" /></fo:block>\r\n						</fo:table-cell>\r\n					</fo:table-row>\r\n				</fo:table-body>\r\n			</fo:table>\r\n			<fo:block font-size=\"14pt\" space-after=\"6pt\">\r\n				<fo:inline><xsl:value-of select=\"birthdate/@age\" /></fo:inline>\r\n				<xsl:choose>\r\n					<xsl:when test=\"gender = \'M\'\">\r\n						<fo:inline> male</fo:inline>\r\n					</xsl:when>\r\n					<xsl:when test=\"gender = \'F\'\">\r\n						<fo:inline> female</fo:inline>\r\n					</xsl:when>\r\n				</xsl:choose>\r\n			</fo:block>\r\n			<fo:block>\r\n				<fo:inline>First Encounter on <xsl:value-of select=\"firstEncounterDate\" /></fo:inline>\r\n			</fo:block>\r\n			<fo:block>\r\n				<fo:inline>WHO Stage: <xsl:value-of select=\"whoStage\" /></fo:inline>\r\n			</fo:block>\r\n			<fo:block>Perfect HIV Rx Adherence (past year): <xsl:value-of select=\"perfectAdherence\" /></fo:block>\r\n			<!-- <fo:block text-align=\"center\" space-before=\"12pt\" space-after=\"12pt\">\r\n				<fo:leader leader-summary=\"rule\" leader-length=\"80%\" color=\"#808080\" />\r\n			</fo:block> -->\r\n			\r\n			<fo:table table-layout=\"fixed\"\r\n				width=\"100%\"\r\n				border-spacing=\"0.25in\" space-before=\"6pt\"\r\n				space-after=\"6pt\">\r\n				<fo:table-column column-width=\"50%\" />\r\n				<fo:table-column column-width=\"50%\" />\r\n				<fo:table-body font-size=\"20pt\">\r\n					<fo:table-row height=\"7cm\">\r\n						<fo:table-cell>\r\n\r\n			<!-- Problem list -->\r\n			<fo:block font-size=\"18pt\"\r\n				space-before=\"8pt\"\r\n				space-after=\"8pt\"><fo:inline text-decoration=\"underline\">Problem List</fo:inline>:</fo:block>\r\n			<xsl:if test=\"problemList/problem\">\r\n				<fo:list-block font-size=\"14pt\" space-after=\"12pt\"\r\n					provisional-label-separation=\"4mm\" provisional-distance-between-starts=\"10mm\">\r\n					<xsl:for-each select=\"problemList/problem\">\r\n					<fo:list-item>\r\n						<fo:list-item-label end-indent=\"label-end()\">\r\n							<fo:block><xsl:value-of select=\"position()\" />.</fo:block>\r\n						</fo:list-item-label>\r\n						<fo:list-item-body start-indent=\"body-start()\">\r\n							<fo:block>\r\n								<xsl:value-of select=\".\" />\r\n								<xsl:if test=\"@date\">\r\n									<xsl:text> (</xsl:text>\r\n									<xsl:value-of select=\"@date\" />\r\n									<xsl:text>)</xsl:text>\r\n								</xsl:if>\r\n							</fo:block>\r\n						</fo:list-item-body>\r\n					</fo:list-item>\r\n					</xsl:for-each>\r\n				</fo:list-block>\r\n			</xsl:if>\r\n\r\n						</fo:table-cell>\r\n						<fo:table-cell>\r\n						\r\n			<!-- Medications -->\r\n			<fo:block font-size=\"18pt\"\r\n				space-before=\"8pt\"\r\n				space-after=\"8pt\"><fo:inline text-decoration=\"underline\">Medications</fo:inline>:</fo:block>\r\n			<xsl:if test=\"medications/medication\">\r\n				<fo:list-block font-size=\"14pt\" space-after=\"12pt\"\r\n					provisional-label-separation=\"4mm\" provisional-distance-between-starts=\"10mm\">\r\n					<xsl:for-each select=\"medications/medication\">\r\n					<fo:list-item>\r\n						<fo:list-item-label end-indent=\"label-end()\">\r\n							<fo:block><xsl:value-of select=\"position()\" />.</fo:block>\r\n						</fo:list-item-label>\r\n						<fo:list-item-body start-indent=\"body-start()\">\r\n							<fo:block>\r\n								<xsl:value-of select=\".\" />\r\n								<!--\r\n								<xsl:if test=\"@date\">\r\n									<xsl:text> (</xsl:text>\r\n									<xsl:value-of select=\"@date\" />\r\n									<xsl:text>)</xsl:text>\r\n								</xsl:if>\r\n								-->\r\n							</fo:block>\r\n						</fo:list-item-body>\r\n					</fo:list-item>\r\n					</xsl:for-each>\r\n				</fo:list-block>\r\n			</xsl:if>\r\n\r\n						</fo:table-cell>\r\n					</fo:table-row>\r\n				</fo:table-body>\r\n			</fo:table>\r\n\r\n			<!-- Flowsheet -->\r\n			<fo:block font-size=\"18pt\"><fo:inline text-decoration=\"underline\">Flowsheet</fo:inline>:</fo:block>\r\n			<fo:table space-after=\"12pt\" table-layout=\"fixed\" width=\"100%\" border-collapse=\"collapse\">\r\n				<xsl:for-each select=\"flowsheet/results\">\r\n				<fo:table-column width=\"16%\" />\r\n				</xsl:for-each>\r\n				<fo:table-body>\r\n					<fo:table-row>\r\n						<xsl:for-each select=\"flowsheet/results\">\r\n							<xsl:element name=\"fo:table-cell\">\r\n								<xsl:attribute name=\"text-align\">center</xsl:attribute>\r\n								<xsl:attribute name=\"padding\">2pt</xsl:attribute>\r\n								<xsl:attribute name=\"border-bottom\">thin solid black</xsl:attribute>\r\n								<xsl:if test=\"not(position()=last())\">\r\n									<xsl:attribute name=\"border-right\">thin solid black</xsl:attribute>\r\n								</xsl:if>\r\n								<fo:block><xsl:value-of select=\"@name\" /></fo:block>\r\n							</xsl:element>\r\n						</xsl:for-each>\r\n					</fo:table-row>\r\n					<xsl:variable name=\"results\" select=\"flowsheet/results\" />\r\n					<xsl:variable name=\"cd4_percent\" select=\"cd4_percent\" />\r\n					<xsl:for-each select=\"(1,2,3,4,5)\">\r\n						<xsl:variable name=\"i\" select=\"position()\" />\r\n						<xsl:element name=\"fo:table-row\">\r\n							<xsl:attribute name=\"background-color\">\r\n								<xsl:if test=\"$i mod 2\">#F8F8F8</xsl:if>\r\n								<xsl:if test=\"not($i mod 2)\">#FFFFFF</xsl:if>\r\n							</xsl:attribute>\r\n							<xsl:attribute name=\"height\">1cm</xsl:attribute>\r\n							<xsl:for-each select=\"$results\">\r\n								<xsl:variable name=\"result_name\" select=\"@name\" />\r\n								<xsl:element name=\"fo:table-cell\">\r\n									<xsl:attribute name=\"text-align\">center</xsl:attribute>\r\n									<xsl:attribute name=\"display-align\">center</xsl:attribute>\r\n									<xsl:attribute name=\"padding\">2pt</xsl:attribute>\r\n									<xsl:if test=\"not(position()=last())\">\r\n										<xsl:attribute name=\"border-right\">thin solid black</xsl:attribute>\r\n									</xsl:if>\r\n									<xsl:choose>\r\n										<xsl:when test=\"($i=5) and (count(value) > 5)\">\r\n											<xsl:variable name=\"result_date\" select=\"value[position()=last()]/@date\" />\r\n											<fo:block>\r\n												<xsl:value-of select=\"value[position()=last()]\" />\r\n												<xsl:if test=\"$result_name=\'CD4\'\">\r\n													<xsl:variable name=\"p\" select=\"$cd4_percent/value[@date=$result_date]\" />\r\n													<xsl:if test=\"$p\">\r\n														<xsl:text> (</xsl:text>\r\n														<xsl:value-of select=\"normalize-space($p[position()=1])\" />\r\n														<xsl:text>%)</xsl:text>\r\n													</xsl:if>\r\n												</xsl:if>\r\n											</fo:block>\r\n											<xsl:if test=\"$result_date\">\r\n												<fo:block font-size=\"6pt\" font-style=\"italic\" color=\"#808080\">on <xsl:value-of select=\"substring($result_date,0,12)\" /></fo:block>\r\n											</xsl:if>\r\n										</xsl:when>\r\n										<xsl:when test=\"value[$i]\">\r\n											<xsl:variable name=\"result_date\" select=\"value[$i]/@date\" />\r\n											<fo:block>\r\n												<xsl:value-of select=\"value[$i]\" />\r\n												<xsl:if test=\"$result_name=\'CD4\'\">\r\n													<xsl:variable name=\"p\" select=\"$cd4_percent/value[@date=$result_date]\" />\r\n													<xsl:if test=\"$p\">\r\n														<xsl:text> (</xsl:text>\r\n														<xsl:value-of select=\"normalize-space($p[position()=1])\" />\r\n														<xsl:text>%)</xsl:text>\r\n													</xsl:if>\r\n												</xsl:if>\r\n											</fo:block>\r\n											<xsl:if test=\"$result_date\">\r\n												<fo:block font-size=\"6pt\" font-style=\"italic\" color=\"#808080\">on <xsl:value-of select=\"substring($result_date,0,12)\" /></fo:block>\r\n											</xsl:if>\r\n										</xsl:when>\r\n										<xsl:otherwise>\r\n											<fo:block></fo:block>\r\n										</xsl:otherwise>\r\n									</xsl:choose>\r\n								</xsl:element>\r\n							</xsl:for-each>\r\n						</xsl:element>\r\n					</xsl:for-each>\r\n				</fo:table-body>\r\n			</fo:table>\r\n			\r\n			<!-- Chest X-ray -->\r\n			<fo:block font-size=\"18pt\" text-decoration=\"underline\" space-after=\"6pt\">\r\n				Chest X-ray\r\n			</fo:block>\r\n			<xsl:choose>\r\n				<xsl:when test=\"cxr\">\r\n					<fo:block><xsl:value-of select=\"cxr/@date\" />: <xsl:value-of select=\"cxr\" /></fo:block>\r\n				</xsl:when>\r\n				<xsl:otherwise>\r\n					<fo:block>No chest x-ray results available.</fo:block>\r\n				</xsl:otherwise>\r\n			</xsl:choose>\r\n			\r\n			<!-- Reminders -->\r\n			<xsl:if test=\"reminderList\">\r\n				<fo:block font-size=\"18pt\" text-decoration=\"underline\" space-before=\"6pt\">\r\n					Reminders\r\n				</fo:block>\r\n				<xsl:for-each select=\"reminderList/reminder\">\r\n					<fo:block space-before=\"6pt\"><xsl:value-of select=\".\" /></fo:block>\r\n				</xsl:for-each>\r\n			</xsl:if>\r\n		</fo:flow>\r\n	</fo:page-sequence>\r\n	</xsl:for-each>\r\n</fo:root>\r\n</xsl:summary>\r\n\r\n</xsl:stylesheet>\r\n',0,1,'2007-03-20 14:20:22',1,'2007-03-21 10:12:34',1,'2b044126-cde0-11e1-a6b2-907bb829a3b7',1);
