INSERT INTO `concept_description` VALUES (1,1,'Anemia due to bleeding or a hemorrhagic process.','en',1,'2004-01-01 00:00:00',NULL,NULL,'41e0b7e6-8dd8-11e1-be2c-e1d7904ed235'),(2,2,'Anemia, due to the destruction or dissolution of red blood cells, with subsequent release of hemoglobin.','en',1,'2004-01-01 00:00:00',NULL,NULL,'41e0bf20-8dd8-11e1-be2c-e1d7904ed235'),(3,3,'Anemia not due to other causes listed within the system.','en',1,'2004-01-01 00:00:00',NULL,NULL,'41e0c0c4-8dd8-11e1-be2c-e1d7904ed235'),(4,4,'An abrupt and/or progressive worsening of symptoms of shortness of breath, wheezing, chest tightness, or some combination of these with associated respiratory distress.','en',1,'2004-01-01 00:00:00',NULL,NULL,'41e0c240-8dd8-11e1-be2c-e1d7904ed235'),(5,5,'A chronic respiratory disease, arising from allergies or inflammation, that is characterized by sudden recurring attacks of labored breathing, chest constriction, and coughing.','en',1,'2004-01-01 00:00:00',NULL,NULL,'41e0c3da-8dd8-11e1-be2c-e1d7904ed235'),(6,6,'subcutaneous immunization for TB; converts PPD to positive','en',1,'2004-01-01 00:00:00',NULL,NULL,'41e0c556-8dd8-11e1-be2c-e1d7904ed235'),(7,7,'Small, hard, pathological concretions, composed chiefly of cholesterol, calcium salts, and bile pigments, formed in the gallbladder or in a bile duct.','en',1,'2004-01-01 00:00:00',NULL,NULL,'41e0c6e6-8dd8-11e1-be2c-e1d7904ed235'),(8,8,'Gallbladder or biliary duct problems not specified.','en',1,'2004-01-01 00:00:00',NULL,NULL,'41e0cdbc-8dd8-11e1-be2c-e1d7904ed235'),(9,9,'serum glucose, elevated in diabetes','en',1,'2004-01-01 00:00:00',NULL,NULL,'41e0cf38-8dd8-11e1-be2c-e1d7904ed235'),(10,10,'Lower respiratory infection of the bronchial tubes, acute.','en',1,'2004-01-01 00:00:00',NULL,NULL,'41e0d0a0-8dd8-11e1-be2c-e1d7904ed235'),(11,11,'Lower respiratory infection of the bronchial tubes, recurrent.','en',1,'2004-01-01 00:00:00',NULL,NULL,'41e0d258-8dd8-11e1-be2c-e1d7904ed235'),(12,12,'An examination using irr