nt to search for a new patient after submitting a form, else set to false if you want to go back to the same patient.','34aec6cc-c575-41d2-8a75-5a6345d964c9',NULL,NULL,NULL,NULL),('xforms.setDefaultLocation','false','Set to true if you want to set the default location to that of the logged on user.','67b9faca-8c41-4734-a2ab-4bd8ff530a88',NULL,NULL,NULL,NULL),('xforms.setDefaultProvider','false','Set to true if you want to set the default provider to the logged on user, if he or she has the provider role.','cd347177-aa25-4d84-8d05-bf4c86a8901d',NULL,NULL,NULL,NULL),('xforms.showDesignSurfaceTab','true','Set to true if you want to display the Design Surface tab of the form designer.','738c6b11-6412-4ed4-9fd1-44e9c9dc814c',NULL,NULL,NULL,NULL),('xforms.showJavaScriptTab','false','Set to true if you want to display the JavaScript tab of the form designer.','7e4efe51-97aa-426d-8306-618b62c81309',NULL,NULL,NULL,NULL),('xforms.showLanguageTab','false','Set to true if you want to display the language xml tab of the form designer.','2de6ffca-0dd6-48f9-955c-a2492d597b84',NULL,NULL,NULL,NULL),('xforms.showLayoutXmlTab','false','Set to true if you want to display the layout xml tab of the form designer.','098576a4-ec50-47b5-b2b4-a8d41ff7087f',NULL,NULL,NULL,NULL),('xforms.showModelXmlTab','false','Set to true if you want to display the model xml tab of the form designer.','44a141ba-6fd8-48a2-a579-696f24dd8752',NULL,NULL,NULL,NULL),('xforms.showOfflineFormDesigner','false','Set to true if you want to show the form designer in off line mode.','52c46535-7b48-49fd-9aa6-64660e29b609',NULL,NULL,NULL,NULL),('xforms.showPreviewTab','true','Set to true if you want to display the Preview tab of the form designer.','04bb4980-ee20-41ec-9417-f1a90433ff14',NULL,NULL,NULL,NULL),('xforms.showSubmitSuccessMsg','false','Set to true if you want to display the form submitted successfully message every time a form is submitted successfully.','67510b5d-566a-4152-948c-562f38ed9a69',NULL,NULL,NULL,NUL