INSERT INTO `htmlformentry_html_form` VALUES (1,1,NULL,'<htmlform>\r\n<script type=\"text/javascript\">\r\nif(jQuery){\r\n$j(document).ready(function(){\r\n   $j(\".trigger\").each(function(i,obj){\r\n    \r\n     if($j(this).find(\':radio\').attr(\"id\")==undefined){\r\n     var disableField = \"#enable_disable\"+$j(this).attr(\'enable_disable\');\r\n     \r\n     if($j(this).find(\'.value\').html().toString()[9] ==\"Y\"){\r\n     $j(disableField).show();\r\n     }\r\n    }\r\n   });\r\n\r\n     $j(\".trigger\").find(\":radio\").change(function(){\r\n       var disableField = \"#enable_disable\"+$j(this).parent().attr(\'enable_disable\');\r\n       var value=$j(this).val();\r\n       if (value==\"true\"){\r\n            $j(disableField).show();\r\n       }else{\r\n             $j(disableField).hide();\r\n      }\r\n     });\r\n});\r\n }\r\n\r\nbeforeSubmit.push(function() {\r\n    var ret=true;\r\n    $j(\".trigger\").each(function(i,obj){\r\n     if( $j(this).find(\':radio:checked\').attr(\'checked\') == true){\r\n    $j(this).find(\'.error\').html(\'\').hide()\r\n    }else{\r\n    ret=false;\r\n    $j(this).find(\'.error\').html(\"Required field\").show()\r\n    }\r\n    });\r\n    \r\n  var val = getValue(\'entryPoint.value\');\r\n    if (val == null || val == \'\') {\r\n        getField(\'entryPoint.error\').html(\'Required field\').show();\r\n        ret=false;\r\n   }else{\r\n   getField(\'entryPoint.error\').html(\'\').hide();\r\n   }\r\n      var val = getValue(\'positiveDate.value\');\r\n      var val2= $j(\'#w12_0\').attr(\'checked\');\r\n      \r\n    if (val2 &amp;&amp; (val == null || val == \'\')) {\r\n        getField(\'positiveDate.error\').html(\'Required field\').show();\r\n        ret=false;\r\n   }else{\r\n   getField(\'positiveDate.error\').html(\'\').hide();\r\n   }\r\n \r\n    return ret;\r\n});\r\n\r\n</script>\r\n\r\n\r\n	<macros>\r\n		paperFormId = MoH 257\r\n		headerColor = #3B5998\r\n		fontOnHeaderColor = white\r\n	</macros>\r\n\r\n	<style>\r\n		.section {\r\n			border: 1px solid $headerColor;\r\n			padding: 2px;\r\n			text-align: left;\r\n			margin-bottom: 1em;\r\n		}\r\n		.sectionHeader {\r\n			background-color: $headerColor;\r\n			color: $fontOnHeaderColor;\r\n			display: block;\r\n			padding: 2px;\r\n			font-weight: bold;\r\n		}\r\n		table.baseline-aligned td {\r\n			vertical-align: baseline;\r\n		}\r\n	</style>\r\n\r\n	<span style=\"float:right\">Paper Form ID: $paperFormId</span>\r\n	<h2>Comprehensive Care Clinic Patient Care Record - Initial Visit</h2>\r\n\r\n	<section headerLabel=\"Consultation Details\">\r\n		<table class=\"baseline-aligned\">\r\n			<tr>\r\n				<td><strong>Date:</strong> <encounterDate default=\"today\"/></td>\r\n				<td><strong>Location:</strong> <encounterLocation default=\"1\"/></td>\r\n				<td><strong>Provider:</strong> <encounterProvider default=\"currentUser\"/></td>\r\n			</tr>\r\n		</table>\r\n	</section>\r\n\r\n	<section headerLabel=\"Patient Profile\">\r\n		<table class=\"baseline-aligned\">\r\n			<tr>\r\n				<td>Unique Patient Number:</td>\r\n				<td><lookup expression=\"patient.getPatientIdentifier(3)\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td>Patient\'s Name:</td>\r\n				<td><lookup class=\"value\" expression=\"patient.personName\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td>Date of Birth:</td>\r\n				<td><lookup class=\"value\" complexExpression=\"#if( \\$patient.birthdateEstimated ) ~#end\"/> <lookup class=\"value\" expression=\"patient.birthdate\"/>\r\n					(Age: <lookup class=\"value\" expression=\"patient.age\"/>)</td>\r\n			</tr>\r\n		</table>\r\n	</section>\r\n	<section headerLabel=\"Patient Source\">\r\n		<table class=\"baseline-aligned\">\r\n			<tr>\r\n				<td><obs conceptId=\"6245\" labelText=\"Entry Point:\" id=\"entryPoint\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td>Date Registered/Transferred In: <enrollInProgram programId=\"1\" showDate=\"true\"/></td>\r\n			</tr>\r\n		</table>\r\n	</section>\r\n	<section headerLabel=\"HIV Status and ART Eligibility\">\r\n		<table class=\"baseline-aligned\">\r\n			 <tr>\r\n                         <td class=\"trigger\" enable_disable=\"1\"> Is HIV date positive known? <obs conceptId=\"6277\" style=\"yes_no\" />\r\n                          </td>\r\n                         </tr>\r\n                         <tbody id=\"enable_disable1\" style=\"display:none\">\r\n                         <tr>\r\n				<td><obs conceptId=\"6259\" labelText=\"Date HIV Positive:\" id=\"positiveDate\"/></td>\r\n			</tr>\r\n                        </tbody>\r\n			<tr>\r\n				<td><obs conceptId=\"6260\" labelText=\"Date Medically Eligible for ART:\"/></td>\r\n			</tr>\r\n		</table>\r\n	</section>\r\n	<section headerLabel=\"Treatment Supporter\">\r\n		<table class=\"baseline-aligned\">\r\n			<tr>\r\n				<td>Name:</td>\r\n				<td><obs conceptId=\"6252\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td>Relationship:</td>\r\n				<td><obs conceptId=\"6253\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postal Address:</td>\r\n				<td><obs conceptId=\"6254\"/></td>\r\n			</tr>\r\n			<tr>\r\n				<td>Telephone Number:</td>\r\n				<td><obs conceptId=\"6255\"/></td>\r\n			</tr>		\r\n		</table>\r\n	</section>\r\n	<submit/>\r\n</htmlform>',1,'2012-07-04 17:17:12',3,'2013-03-20 20:38:20',0,'2b928ea3-32f5-4a77-80b6-6e8364cd34eb',NULL,NULL,NULL,NULL),(2,2,NULL,'<htmlform>\r\n<!-- Add javascript to show and hide sections of the form -->\r\n<script type=\"text/javascript\">\r\nif(jQuery){\r\n$j(document).ready(function(){\r\n   $j(\".trigger\").each(function(i,obj){\r\n    \r\n     if($j(this).find(\':radio\').attr(\"id\")==undefined){\r\n     var disableField = \"#enable_disable\"+$j(this).attr(\'enable_disable\');\r\n     \r\n     if($j(this).find(\'.value\').html().toString()[9] ==\"Y\"){\r\n     $j(disableField).show();\r\n     }\r\n    }\r\n   });\r\n\r\n     $j(\".trigger\").find(\":radio\").change(function(){\r\n       var disableField = \"#enable_disable\"+$j(this).parent().attr(\'enable_disable\');\r\n       var value=$j(thi