disable3_no\").hide();\r\n             }\r\n            if ($j(this).parent().attr(\'enable_disable\')==\"2\"){\r\n             $j(\"#enable_disable3_yes\").hide();\r\n             $j(\"#enable_disable3_no\").hide();\r\n             }\r\n       }\r\n     });\r\n});\r\n }\r\n\r\nbeforeSubmit.push(function() {\r\n    var ret=true;\r\n    $j(\".trigger\").each(function(i,obj){\r\n    \r\n     if ($j(this).attr(\'enable_disable\')==\"1\"){\r\n \r\n     if( $j(this).find(\':radio:checked\').attr(\'checked\') == true){\r\n    $j(this).find(\'.error\').html(\'\').hide()\r\n    }else{\r\n    ret=false;\r\n    $j(this).find(\'.error\').html(\"Required field\").show()\r\n    }\r\n    }\r\n    });\r\n \r\n    return ret;\r\n});\r\n</script>\r\n\r\n	<!-- Autogenerated example form  (template from 01-Nov-2010 -->\r\n	<macros>\r\n		paperFormId = (Fill this in)\r\n		headerColor =#3B5998\r\n		fontOnHeaderColor = white\r\n	</macros>\r\n\r\n	<style>\r\n		.section {\r\n			border: 1px solid $headerColor;\r\n			padding: 2px;\r\n			text-align: left;\r\n			margin-bottom: 1em;\r\n		}\r\n		.sectionHeader {\r\n			background-color: $headerColor;\r\n			color: $fontOnHeaderColor;\r\n			display: block;\r\n			padding: 2px;\r\n			font-weight: bold;\r\n		}\r\n		table.baseline-aligned td {\r\n			vertical-align: baseline;\r\n		}\r\n	</style>\r\n\r\n	<span style=\"float:right\">Paper Form ID: $paperFormId</span>\r\n	<h2>Patient Follow-up form (v)</h2>\r\n\r\n	<section headerLabel=\"1. Encounter Details\">\r\n		<table class=\"baseline-aligned\">\r\n			<tr>\r\n				<td>Date:</td>\r\n				<td><encounterDate default=\"today\"/></td>\r\n\r\n				<td>Location:</td>\r\n				<td><encounterLocation default=\"1\"/></td>\r\n				<td>Provider:</td>\r\n				<td><encounterProvider/></td>\r\n			</tr>\r\n		</table>\r\n	</section>\r\n\r\n	<section headerLabel=\"Patient Summary\">\r\n		<table class=\"baseline-aligned\">\r\n\r\n		\r\n			<tr>\r\n				<td>UPN:</td>\r\n				<td><lookup class=\"value\" complexExpression=\"#foreach(