INSERT INTO `patientflags_flag` VALUES (24,'Missing Maternal Profile','select patient.patient_id from patient where patient_id not in (select patient_id from encounter where form_id=5) and patient.patient_id in (select person_id from person where birthdate < date_sub(curdate(), interval 5 year))','Missing Maternal Profile',1,'org.openmrs.module.patientflags.evaluator.SQLFlagEvaluator',NULL,3,'2013-03-20 21:47:30',3,'2013-03-22 12:20:09',0,NULL,NULL,NULL,'00566068-9437-4d2d-a152-2d86d29bc7a0',2),(25,'Missing Clinic Visit','select p.patient_id from (select patient_id, max(encounter_datetime) as m from encounter group by patient_id) as p where p.m< date_sub(curdate(),interval 90 day)','Patient not attended Clinic for >3 months',1,'org.openmrs.module.patientflags.evaluator.SQLFlagEvaluator',NULL,3,'2013-03-20 22:10:02',3,'2013-03-21 21:21:45',0,NULL,NULL,NULL,'8e9d9d79-e570-4505-83d5-def19cea27a3',2),(26,'Danger Sign: Vaginal Bleeding','select distinct p.patient_id from obs o inner join patient p \r\non o.person_id = p.patient_id \r\ninner join (select person_id, max(obs_datetime) as max_datetime \r\nfrom obs where concept_id = 6368 group by person_id) \r\nmaximum on o.person_id = maximum.person_id \r\nand o.obs_datetime = maximum.max_datetime where o.value_numeric=1 and o.concept_id=6368;','Danger Sign: Vaginal Bleeding',1,'org.openmrs.module.patientflags.evaluator.SQLFlagEvaluator',NULL,3,'2013-03-20 22:22:29',3,'2013-03-20 22:46:28',0,NULL,NULL,NULL,'29ad1750-2329-4487-8ee4-ff617d6fc2a5',1),(27,'Missing First Clinic Visit (Maternal)','select patient.patient_id from patient where patient_id not in (select patient_id from encounter where form_id=6) and patient.patient_id in (select person_id from person where birthdate < date_sub(curdate(), interval 5 year))','Missing First Clinic Visit',1,'org.openmrs.module.patientflags.evaluator.SQLFlagEvaluator',NULL,3,'2013-03-21 21:10:31',3,'2013-03-24 21:43:50',0,NULL,NULL,NULL,'735517be-33a3-44c4-be8c-d7d5031d2746',2),(28,'Missing Program Enrolment Date','select patient.patient_id from patient where patient_id not in (select patient_id from patient_program where date_enrolled is not null and voided=0)','Missing Program Enrolment Date',1,'org.openmrs.module.patientflags.evaluator.SQLFlagEvaluator',NULL,3,'2013-03-21 21:12:41',3,'2013-03-21 21:47:42',0,NULL,NULL,NULL,'5e92a4f8-fcd6-4156-946b-4edceb7f6deb',2),(29,'Missing Program Enrolment Location','select patient.patient_id from patient where patient_id not in (select patient_id from patient_program where location_id is not null and voided=0)','Missing Program Enrolment Location',1,'org.openmrs.module.patientflags.evaluator.SQLFlagEvaluator',NULL,3,'2013-03-21 21:13:20',3,'2013-03-21 21:53:58',0,NULL,NULL,NULL,'d6e4acf6-b58c-4fe4-b11b-c05b97727d49',2),(30,'Danger Sign: Fits','select distinct p.patient_id from obs o inner join patient p \r\non o.person_id = p.patient_id \r\ninner join (select person_id, max(obs_datetime) as max_datetime \r\nfrom obs where concept_id = 6369 group by person_id) \r\nmaximum on o.person_id = maximum.person_id \r\nand o.obs_datetime = maximum.max_datetime where o.value_numeric=1 and o.concept_id=6369;','Danger Sign: Fits',1,'org.openmrs.module.patientflags.evaluator.SQLFlagEvaluator',NULL,3,'2013-03-21 21:17:26',3,'2013-03-21 21:21:17',0,NULL,NULL,NULL,'838d2b8b-0e92-497a-a7ee-961c590ebf67',1),(31,'Danger Sign: Severe abdominal pain','select distinct p.patient_id from obs o inner join patient p \r\non o.person_id = p.patient_id \r\ninner join (select person_id, max(obs_datetime) as max_datetime \r\nfrom obs where concept_id = 6370 group by person_id) \r\nmaximum on o.person_id = maximum.person_id \r\nand o.obs_datetime = maximum.max_datetime where o.value_numeric=1 and o.concept_id=6370;','Danger Sign: Severe abdominal pain',1,'org.openmrs.module.patientflags.evaluator.SQLFlagEvaluator',NULL,3,'2013-03-21 21:18:02',3,'2013-03-21 21:20:57',0,NULL,NULL,NULL,'88e660bc-9f6a-43c4-be63-e7562a8f86ad',1),(32,'Danger Sig