y person_id) \r\nmaximum on o.person_id = maximum.person_id \r\nand o.obs_datetime = maximum.max_datetime where o.value_numeric=1 and o.concept_id=6374;','Danger Sign: Reduced Foetal Movements',1,'org.openmrs.module.patientflags.evaluator.SQLFlagEvaluator',NULL,3,'2013-03-21 21:20:16',NULL,NULL,0,NULL,NULL,NULL,'3e264a51-e5ad-4f16-89b1-69f456ca619a',1),(36,'HIV Status','select p.patient_id from (select person_id as patient_id from obs where concept_id=1040 and value_coded=703 and voided=0) as p where p.patient_id is not null','HIV status: Please ensure prophylaxis',1,'org.openmrs.module.patientflags.evaluator.SQLFlagEvaluator',NULL,3,'2013-03-21 21:31:57',3,'2013-03-21 21:43:50',0,NULL,NULL,NULL,'8ccf40d5-c1b8-476e-acb8-779c736e028b',1),(37,'Missing Child Profile','select patient.patient_id from patient where patient_id not in (select patient_id from encounter where form_id=11) and patient.patient_id in (select person_id from person where birthdate > date_sub(curdate(), interval 5 year))','Missing Child Profile',1,'org.openmrs.module.patientflags.evaluator.SQLFlagEvaluator',NULL,3,'2013-03-24 21:41:05',3,'2013-03-24 21:50:49',0,NULL,NULL,NULL,'baea1658-0768-406f-94c1-150062124b37',2),(38,'Missing First Clinic Visit (Child)','select patient.patient_id from patient where patient_id not in (select patient_id from encounter where form_id=12) and patient.patient_id in (select person_id from person where birthdate < date_sub(curdate(), interval 5 year))','Missing First Clinic Visit',1,'org.openmrs.module.patientflags.evaluator.SQLFlagEvaluator',NULL,3,'2013-03-24 21:44:26',3,'2013-03-24 21:50:10',0,NULL,NULL,NULL,'2212fdc0-3b01-40fa-b4cf-e92532420ff3',2);
