INSERT INTO `scheduler_task_config` VALUES (1,'Update Concept Index','Iterates through the concept dictionary, re-creating the concept index (which are used for searcing). This task is started when using the \'Update Concept Index Storage\' page and no range is given.  This task stops itself when one iteration has completed.','org.openmrs.scheduler.tasks.ConceptIndexUpdateTask',NULL,NULL,0,0,0,1,'2005-01-01 00:00:00',2,'2012-06-24 19:52:51',NULL,'7c75911e-0310-11e0-8222-18a905e044dc'),(2,'Auto Close Visits Task','Stops all active visits that match the visit type(s) specified by the value of the global property \'autoCloseVisits.visitType\'','org.openmrs.scheduler.tasks.AutoCloseVisitsTask','2011-11-28 23:59:59','MM/dd/yyyy HH:mm:ss',86400,0,0,1,'2012-06-24 19:50:17',NULL,NULL,NULL,'8c17b376-1a2b-11e1-a51a-00248140a5eb'),(3,'Initialize Logic Rule Providers',NULL,'org.openmrs.logic.task.InitializeLogicRuleProvidersTask','2013-03-26 13:50:46',NULL,1999999999,0,1,2,'2012-06-24 19:51:50',2,'2013-03-26 13:50:47','2013-03-26 13:50:47','7b620e25-5ef3-4543-afba-bf6d32cf654b');
