\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>125</id>\n  <query>select t. patient_id from (select sum(concept_id) as s,patient_id,start_date from orders where (start_date&lt;:endDate and (discontinued=0 or discontinued_date &gt; :endDate)) group by patient_id,start_date) as t where (t.s in(1263,1261,6884,6144,2061,792,6143)) and t.patient_id in (select patient_id from patient_program where program_id=1 and location_id=:location);</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2012-09-26 08:37:37',1,'2012-09-26 08:37:37',3,0,NULL,NULL,NULL,'ea0c26fd-034b-43ae-9801-efa4b8762b2f'),(126,'Telephone number - Patient','','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"fdbe4556-c741-4fb0-b456-d48701e4870e\" retired=\"false\">\n  <name>Telephone number - Patient</name>\n  <description></description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>126</id>\n  <query>select person_id from person_attribute where person_attribute_type_id = 8 and person_id in (SELECT patient_id from patient_program where program_id=1 and location_id=:location and voided=0);</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2012-09-24 11:14:04',1,'2012-09-24 11:14:04',3,0,NULL,NULL,NULL,'fdbe4556-c741-4fb0-b456-d48701e4870e'),(127,'Not Currently Started - ART','','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"60d72a88-e72e-4bbb-bd35-59f80926e505\" retired=\"false\">\n  <name>Not Currently Started - ART</name>\n  <description></description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.r